import React from "react";

export const Header = ({
  setSearchByName,
  setSearchByCountry,
  setSearchMinHeight,
  sort,
  setSort,
}) => {
  const handleOnChangeName = (event) => {
    setSearchByName(event.target.value);
  };

  const handleOnChangeCountry = (event) => {
    setSearchByCountry(event.target.value);
  };

  const handleOnChangeHeight = (event) => {
    setSearchMinHeight(event.target.value);
  };

  return (
    <header>
      <h1>Cool volcanos</h1>
      <div>
        <input
          type="text"
          placeholder="Find volcano"
          onChange={(event) => handleOnChangeName(event)}
        />

        <input
          type="text"
          placeholder="Find country"
          onChange={(event) => handleOnChangeCountry(event)}
        />

        <input
          type="number"
          placeholder="Min height"
          onChange={(event) => handleOnChangeHeight(event)}
        />

        <select
          onChange={(event) => setLimit(event.target.value)}
          value={limit}
        >
          <option value="20">20 books per page</option>
          <option value="40">40 books per page</option>
          <option value="60">60 books per page</option>
          <option value="100">100 books per page</option>
        </select>
      </div>
    </header>
  );
};
